import "./Order.css";

const Order = (props) => {
  console.log(props);
  return (
    <div className="Order">
      <h2 className="order-string">{props.orderString}</h2>
      <h2 className="order-price">Price: ${props.price}</h2>
      <h2 className="order-by">By: {props.customer.name}</h2>
    </div>
  );
};
export default Order;
